import React from 'react';

const MyDashboard = () => {
  return (
    <div>
      <h1>My Dashboard</h1>
      <iframe
        src="/Dash.html" // Update this with the actual path to your HTML file
        width="100%"
        height="1000px"
      />
    </div>
  );
};


export default MyDashboard;
